import React, { useEffect, useState } from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'


const NavBar = ( { navToExperience}) => {
    const [navLinkId, setNavLinkId] = useState('')
    useEffect(() => {
        navToExperience()
    }, [navLinkId])

    return (
        <NavBarContainer>
            <NavigationContainer>
                <NavigationButton onClick={() => setNavLinkId('about')}>About</NavigationButton>
                <NavigationButton onClick={() => setNavLinkId('experience')}>Experience</NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
